import { Form } from 'react-bootstrap';

const ContactForm = () => {
    return (
        <>
            <Form>
                <Form.Group>
                    <Form.Label>Name</Form.Label>
                    <Form.Control />
                </Form.Group>
            </Form>
        </>
    )
}

export default ContactForm
